import React from 'react'

const Benefits = props => {
  const { icon, description } = props
  return (
    <div className="column is-flex">
      <div className="box box-shadow border-bottom-light-green is-light is-border-radius-less is-full mt-2rem">
        <figure className="image is-64x64 is-img-center benefits-icon">
          <img
            className="is-rounded border-light-green"
            src={icon}
            alt={description}
          />
        </figure>
        <h4 className="is-size-7 mt-1rem">{description}</h4>
      </div>
    </div>
  )
}

export default Benefits
